    "materials-in-the-u-s-municipal-waste-stream-1960-to-2012-in-tons",nt"isopen":
    false,nt"url": null,nt"notes": "The U.S. Environmental Protection Agency
    (EPA) has collected and reported data on the generation and disposal of waste in
    the United States for more than 30 years. We use this information to measure the
    success of waste reduction and recycling programs across the country. Our trash,
    or municipal solid waste (MSW), is made up of the things we commonly use and then
    throw away. These materials include items such as packaging, food scraps, grass
    clippings, sofas, computers, tires, and refrigerators. MSW does not include industrial,
    hazardous, or construction waste. The data in Materials and Products in the Municipal
    Waste Stream,  1960 to 2012, provides estimated data in thousands of tons discarded
    after recycling and compost recovery for the years 1960, 1970, 1980, 1990, 2000,
    2005, 2008, 2010, 2011, and 2012. In this data set, discards include combustion
    with energy recovery. This data table does not include construction & demolition
    debris, industrial process wastes, or certain other wastes. Details may not add
    to totals due to rounding.",nt"license_title": null,nt"extras": [{ntt"key":
